CREATE TABLE `aa_agent` (   `user_id` int(10) unsigned NOT NULL,   `bank` varchar(200) NOT NULL DEFAULT '' COMMENT 'Наименование банка',   `rs` varchar(200) NOT NULL DEFAULT '' COMMENT 'Расчетный счет',   `ks` varchar(200) NOT NULL DEFAULT '' COMMENT 'Кор.счет',   `bik` varchar(200) NOT NULL DEFAULT '' COMMENT 'БИК',   `inn` varchar(200) NOT NULL DEFAULT '' COMMENT 'ИНН',   `kpp` varchar(200) NOT NULL DEFAULT '' COMMENT 'КПП',   `ur_address` varchar(200) NOT NULL DEFAULT '' COMMENT 'юр адрес',   `fakt_address` varchar(200) NOT NULL DEFAULT '' COMMENT 'факт адрес',   `phone` varchar(200) NOT NULL DEFAULT '' COMMENT 'телефон',   `fee` int(2) NOT NULL DEFAULT '0' COMMENT 'Комиссия агента',   `timecreate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,   PRIMARY KEY (`user_id`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Агенты';
CREATE TABLE `aa_buyer_fiz` (   `id` int(11) NOT NULL AUTO_INCREMENT,   `id_schet` int(11) unsigned NOT NULL,   `name` varchar(100) NOT NULL DEFAULT '' COMMENT 'имя',   `surname` varchar(100) NOT NULL DEFAULT '' COMMENT 'фамилия',   `patronymic` varchar(100) NOT NULL DEFAULT '' COMMENT 'отчество',   `address` varchar(300) NOT NULL DEFAULT '' COMMENT 'Адрес',   `birthday` date NOT NULL COMMENT 'дата рождения',   `pass_seria` varchar(20) NOT NULL COMMENT 'паспорт серия',   `pass_num` varchar(20) NOT NULL COMMENT 'паспорт номер',   `pass_date` date NOT NULL COMMENT 'паспорт дата выдачи',   `pass_who` varchar(200) NOT NULL COMMENT 'паспорт кем выдан',   `phone` varchar(200) NOT NULL COMMENT 'телефон',   `email` varchar(200) NOT NULL COMMENT 'email',   `timecreate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,   PRIMARY KEY (`id`) ) ENGINE=InnoDB AUTO_INCREMENT=39 DEFAULT CHARSET=utf8 COMMENT='Покупатели физ';
CREATE TABLE `aa_buyer_ur` (   `id` int(10) unsigned NOT NULL AUTO_INCREMENT,   `id_schet` int(10) unsigned NOT NULL,   `name` varchar(200) NOT NULL DEFAULT '' COMMENT 'Наименование агентства',   `bank` varchar(200) NOT NULL DEFAULT '' COMMENT 'Наименование банка',   `rs` varchar(200) NOT NULL DEFAULT '' COMMENT 'Расчетный счет',   `ks` varchar(200) NOT NULL DEFAULT '' COMMENT 'Кор.счет',   `bik` varchar(200) NOT NULL DEFAULT '' COMMENT 'БИК',   `inn` varchar(200) NOT NULL DEFAULT '' COMMENT 'ИНН',   `kpp` varchar(200) NOT NULL DEFAULT '' COMMENT 'КПП',   `ur_address` varchar(200) NOT NULL DEFAULT '' COMMENT 'юр адрес',   `fakt_address` varchar(200) NOT NULL DEFAULT '' COMMENT 'факт адрес',   `phone` varchar(200) NOT NULL DEFAULT '' COMMENT 'телефон',   `timecreate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,   PRIMARY KEY (`id`) ) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8 COMMENT='Покупатель юр';
CREATE TABLE `aa_city` (   `id` int(11) NOT NULL AUTO_INCREMENT,   `name` varchar(200) NOT NULL,   `timecreate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,   PRIMARY KEY (`id`) ) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8;
CREATE TABLE `aa_class` (   `id` smallint(5) unsigned NOT NULL,   `id_teplohod` smallint(5) unsigned NOT NULL,   `name` varchar(50) NOT NULL,   `timecreate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Классы кают';
CREATE TABLE `aa_deck` (   `id` smallint(5) unsigned NOT NULL,   `id_teplohod` smallint(5) unsigned NOT NULL,   `name` varchar(50) NOT NULL,   `timecreate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Палуба';
CREATE TABLE `aa_discount` (   `id_tur` smallint(5) unsigned NOT NULL COMMENT 'id тура',   `num` varchar(10) NOT NULL COMMENT 'номер каюты',   `type_discount` enum('happy','special') NOT NULL COMMENT 'тип скидки',   `timecreate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,   PRIMARY KEY (`id_tur`,`num`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Каюты со скидками';
CREATE TABLE `aa_kauta` (   `id` int(10) unsigned NOT NULL AUTO_INCREMENT,   `num` varchar(10) NOT NULL COMMENT 'номер каюты',   `id_teplohod` smallint(5) unsigned NOT NULL,   `id_class` varchar(50) DEFAULT NULL COMMENT 'класс каюты',   `deck` varchar(20) DEFAULT NULL COMMENT 'Палуба',   `side` tinyint(1) unsigned DEFAULT NULL COMMENT 'борт ( 0-левый,1-правый)',   `timecreate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,   PRIMARY KEY (`id`),   UNIQUE KEY `num_id_teplohod` (`num`,`id_teplohod`) ) ENGINE=InnoDB AUTO_INCREMENT=4914 DEFAULT CHARSET=utf8 COMMENT='Каюты';
CREATE TABLE `aa_order` (   `id` int(11) NOT NULL AUTO_INCREMENT,   `id_schet` int(10) unsigned NOT NULL COMMENT 'счет',   `num` varchar(20) NOT NULL COMMENT '﻿номер каюты',   `places` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT 'размещение',   `is_delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0-норм,1-удал',   `timecreate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,   PRIMARY KEY (`id`) ) ENGINE=InnoDB AUTO_INCREMENT=66 DEFAULT CHARSET=utf8 COMMENT='каюты заказанные';
CREATE TABLE `aa_place` (   `id` int(11) NOT NULL AUTO_INCREMENT,   `id_order` int(11) NOT NULL,   `price` int(11) unsigned NOT NULL DEFAULT '0' COMMENT 'Цена',   `type_price` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT 'взр,дет, пенс....',   `name` varchar(100) NOT NULL DEFAULT '' COMMENT 'имя',   `surname` varchar(100) NOT NULL DEFAULT '' COMMENT 'фамилия',   `patronymic` varchar(100) NOT NULL DEFAULT '' COMMENT 'отчество',   `birthday` date NOT NULL COMMENT 'дата рождения',   `pass_seria` varchar(20) NOT NULL COMMENT 'паспорт серия',   `pass_num` varchar(20) NOT NULL COMMENT 'паспорт номер',   `pass_date` date NOT NULL COMMENT 'паспорт дата выдачи',   `pass_who` varchar(200) NOT NULL COMMENT 'паспорт кем выдан',   `timecreate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,   PRIMARY KEY (`id`) ) ENGINE=InnoDB AUTO_INCREMENT=90 DEFAULT CHARSET=utf8 COMMENT='Туристы';
CREATE TABLE `aa_price` (   `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,   `id_tariff` tinyint(1) unsigned NOT NULL COMMENT 'тип тарифа',   `id_tur` smallint(5) unsigned NOT NULL COMMENT 'id тура',   `id_deck` smallint(5) unsigned NOT NULL COMMENT 'id палубы',   `id_class` smallint(5) unsigned NOT NULL COMMENT 'id класс каюты',   `deck_name` varchar(20) NOT NULL COMMENT 'Палуба',   `rt_name` varchar(50) NOT NULL COMMENT 'тип каюты',   `rp_name` varchar(50) NOT NULL COMMENT 'размещение , колво',   `price` int(11) NOT NULL COMMENT 'цена',   `timecreate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,   PRIMARY KEY (`id`) ) ENGINE=InnoDB AUTO_INCREMENT=20472 DEFAULT CHARSET=utf8 COMMENT='Цены';
